import React from "react";
import Home from "./Home";
import { Switch,BrowserRouter as Router, Route, NavLink } from 'react-router-dom';


const App=()=>{
    return(
        <Switch>
            <Route path=""></Route>
        <Home/>
        </Switch>
    );
}
export default App;
